import React from "react";
import carServices from "../services/carServices";

class CarComponent extends React.Component {

        constructor(props) {
            super(props)
            this.state = {
                cars:[]
            }
        }

        componentDidMount() {
            carServices.getCars().then((response) => {
                this.setState({cars: response.data})
            });
        }

        render (){
            return (
                <div>
                    <h1>AutoShow.by</h1>
                    <table>
                        <thead>
                            <tr>
                                <td>Brand</td>
                                <td>Model</td>
                                <td>Release Yeahr</td>
                                <td>Prise</td>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.cars.map(
                                    car =>
                                    <tr key = {car.id}>
                                        <td>{car.carBrand}</td>
                                        <td>{car.model}</td>
                                        <td>{car.yearRelease}</td>
                                        <td>{car.prise}</td>
                                        <td><img src ={car.imageCar}></img></td>
                                    </tr>
                                )
                            }

                        </tbody>
                    </table>

                </div>
            )
        }
}

export default CarComponent
